<template>
    <div class="renderer">
        <div
            ref="main"
        ></div>
    </div>
</template>

<script lang="ts">
import Vue from 'vue';
import { mapMutations, mapState } from 'vuex';
import * as THREE from 'three';
import { OBJLoader } from 'three/examples/jsm/loaders/OBJLoader.js';
import { OrbitControls } from 'three/examples/jsm/controls/OrbitControls';
import { defaults } from 'assets/beton/defaults';

const SIZE = 1; // dynamic scene size for edge debugging
const OBJECTS = {
    lights: [
        {
            position: { x: 50 * SIZE, y: 30 * SIZE, z: -15 * SIZE },
            intensity: 40,
            distance: 100 * SIZE,
        },
        {
            position: { x: -32 * SIZE, y: 7 * SIZE, z: -8 * SIZE },
            intensity: 7,
            distance: 1000 * SIZE,
        },
    ],
    cubes: [
        {
            position: { x: -0.7, y: 0, z: -0.75 },
            rotation: { x: 0, y: 0.17, z: 0 },
        },
        {
            position: { x: 1, y: 0, z: -5.5 },
            rotation: { x: 0, y: -0.28, z: 0 },
        },
        {
            position: { x: 3.4, y: 0, z: -11 },
            rotation: { x: 0, y: 0.36, z: 0 },
        },
        {
            position: { x: -4.5, y: 0, z: -14 },
            rotation: { x: 0, y: 0.1, z: 0 },
        },
    ],
};

type ScreenSize = {
    x: number,
    y: number,
}

const textureDataUrls = {
    concrete1: 'data:image/jpeg;base64,',
    concrete: 'data:image/jpeg;base64,',
};

export default Vue.extend({
    computed: {
        ...mapState([
            'settings',
            'stopMultiplicator',
        ]),
    },
    data() {
        return {
            window,
            cubes: [],
        }
    },
    methods: {
        ...mapMutations([
            'SET_STOP_MULTIPLICATOR',
        ]),
        getVisibleScreenSize(camera: THREE.PerspectiveCamera, cameraDistance: number): ScreenSize {
            const vFOV = THREE.MathUtils.degToRad(camera.fov);
            const height = 2 * Math.tan(vFOV / 2) * cameraDistance;
            const width = height * camera.aspect;

            return {
                x: width,
                y: height,
            }
        },
        async initThree(): Promise<void> {
            const scene = new THREE.Scene();

            const camera = new THREE.PerspectiveCamera(
                // Field of view
                45,
                // Aspect ratio
                window.innerWidth / window.innerHeight,
                // Near clipping plane (beyond which nothing is visible)
                1,
                // Far clipping plane (beyond which nothing is visible)
                1000
            );


            /**
             * Create a Three.js sphere.
             * @param {number} radius The sphere's radius in Units.
             * @return The Three.js sphere
             */
            const getCube = (radius, material) => {
                const cubeGeometry = new THREE.BoxBufferGeometry(radius * 2, radius * 2, radius * 2);
                const cubeMaterial = new THREE.MeshPhysicalMaterial(material);
                // const geo = new THREE.BoxGeometry(radius * 5, radius * 5, radius * 5);
                // const material = new THREE.MeshStandardMaterial({ color: 0xffffff });
                const mesh = new THREE.Mesh(cubeGeometry, cubeMaterial);
                mesh.castShadow = true;

                return mesh;
            };

            /**
             * Create a Three.js plane with both sides rendered.
             * @param {number} w The plane's width
             * @param {number} h The plane's height
             * @return The Three.js plane
             */
            const plane = (w, h) => {
                const geo = new THREE.PlaneGeometry(w, h);
                const material = new THREE.MeshStandardMaterial({
                    color: 0xffffff,
                    side: THREE.DoubleSide,
                });
                const mesh = new THREE.Mesh(geo, material);
                mesh.receiveShadow = true;

                return mesh;
            }

            /**
             * Create a Three.js spotlight
             * @param {number} color The light's color (preferably in hexadecimal)
             * @param {number} intensity The light's intensity
             * @return The Three.js spotlight
             */
            const spotlight = (color, intensity) => {
                const light = new THREE.PointLight(color, intensity);
                light.castShadow = true;
                light.shadow.mapSize.x = 4096;
                light.shadow.mapSize.y = 4096;

                return light;
            }

            /**
             * Url to a concrete texture from https://codepen.io/jo12bar/pen/LjgVgV
             * @return The url
             */
            const concreteTextureUrl = () => textureDataUrls.concrete1;

            const textureLoader = new THREE.TextureLoader();

            const renderer = new THREE.WebGLRenderer({ antialias: true });
            renderer.toneMapping = THREE.ACESFilmicToneMapping;
            renderer.toneMappingExposure = 1.25;
            renderer.shadowMap.enabled = true;

            this.$refs.main.appendChild(renderer.domElement);
            renderer.setSize(window.innerWidth, window.innerHeight);

            let kellerObj = null;
            const objLoader = new OBJLoader();
            objLoader.load(
                '/obj/keller480.obj',
                function (object) {
                    kellerObj = object;
                },
                function (xhr) {
                    console.log((xhr.loaded / xhr.total * 100) + '% loaded');
                },
                function (error) {
                    console.log('An error happened');
                }
            );

            // Add a plane
            const plane1 = plane(1000, 1000);
            scene.add(plane1);
            // PI / 2 = 90 degrees
            plane1.rotation.x = Math.PI / 2;

            const plane1Material = plane1.material;
            plane1Material.bumpScale = 0.25;
            plane1Material.roughness = 0.65;
            plane1Material.metalness = 0;

            // Add a texture to the plane
            const concreteTexture = textureLoader.load(concreteTextureUrl());
            plane1Material.map = concreteTexture;
            plane1Material.bumpMap = concreteTexture;
            plane1Material.roughnessMap = concreteTexture;

            const concreteTextureRepetition = 32;
            ['map', 'bumpMap', 'roughnessMap'].forEach(mapName => {
                plane1Material[mapName].wrapS = THREE.RepeatWrapping;
                plane1Material[mapName].wrapT = THREE.RepeatWrapping;
                plane1Material[mapName].repeat.set(
                    concreteTextureRepetition,
                    concreteTextureRepetition
                );
            })

            // const fog = new THREE.Fog('#000000', 40, 90);
            const fog = new THREE.FogExp2('#000000', 0.005);
            scene.fog = fog;


            // Add first spotlight
            const spotlight1 = spotlight('rgb(255, 200, 255)', 1);
            scene.add(spotlight1);
            spotlight1.name = 'spotlight1';
            spotlight1.position.x = 6;
            spotlight1.position.y = 8;
            spotlight1.position.z = -20;

            // Add second spotlight
            const spotlight2 = spotlight('rgb(255, 200, 255)', 1);
            scene.add(spotlight2);
            spotlight2.name = 'spotlight2';
            spotlight2.position.x = -16;
            spotlight2.position.y = 6;
            spotlight2.position.z = 5;

            // Position camera
            camera.position.x = 0;
            camera.position.y = 16;
            camera.position.z = 24;
            camera.lookAt(new THREE.Vector3(0, 0, 0));

            renderer.render(scene, camera);

            let keyframe = 0;

            let renderMatrix = [];

            const totalColumnsMax = defaults.totalColumns.max;
            const totalRowsMax = defaults.totalRows.max;

            // create matrix with maximum dimensions
            for (let rowIndex = 0; rowIndex < totalRowsMax; rowIndex++) {
                const columns = [];
                for (let columnIndex = 0; columnIndex < totalColumnsMax; columnIndex++) {
                    columns[columnIndex] = null;
                }
                renderMatrix[rowIndex] = columns;
            }

            const objectMatrix = JSON.parse(JSON.stringify(renderMatrix));

            const animate = (renderer, scene, camera) => {
                renderer.render(scene, camera);
                keyframe++;

                if (keyframe % 10 === 0) {
                    const spotlight1 = scene.getObjectByName('spotlight1');
                    spotlight1.intensity += (Math.random() - 0.5) * 0.025;
                    spotlight1.intensity = Math.abs(spotlight1.intensity);
    
                    const spotlight2 = scene.getObjectByName('spotlight2');
                    spotlight2.intensity += (Math.random() - 0.5) * 0.015;
                    spotlight2.intensity = Math.abs(spotlight2.intensity);


                    if (kellerObj !== null) {
                        // fill matrix with info about content
                        for (let rowIndex = 0; rowIndex < totalRowsMax; rowIndex++) {
                            const columns = [];
                            for (let columnIndex = 0; columnIndex < totalColumnsMax; columnIndex++) {
                                if (rowIndex <= this.settings.totalRows && columnIndex <= this.settings.totalColumns) {
                                    columns[columnIndex] = (columnIndex === this.settings.currentColumn ? this.settings.columnType : 0);
                                } else {
                                    columns[columnIndex] = null;
                                }
                            }
                            renderMatrix[rowIndex] = columns;
                        }

                        // remove legacy objects from object matrix and fill with new ones
                        renderMatrix.forEach((row, rowIndex) => {
                            row.forEach((column, columnIndex) => {
                                const currentCell = objectMatrix[rowIndex][columnIndex];
                                if (renderMatrix[rowIndex][columnIndex] !== null) { // if cell qualifies for a object
                                    if (currentCell) { // if there's already an object in this cell
                                        scene.remove(currentCell);
                                        objectMatrix[rowIndex][columnIndex] = null;
                                    }
                                    objectMatrix[rowIndex][columnIndex] = kellerObj.clone();
                                    objectMatrix[rowIndex][columnIndex].name = objectMatrix[rowIndex][columnIndex].uuid;
                                    scene.add(objectMatrix[rowIndex][columnIndex]);
                                    // let measure = new THREE.Vector3();
                                    let posX = rowIndex * 4; // eigentlich 0, als fallback
                                    // if (typeof newObjectMatrix[rowIndex][columnIndex - 1] === 'object') {
                                    //     posX = newObjectMatrix[rowIndex][columnIndex - 1].children[0].getSize(measure)[0];
                                    // }
                                    objectMatrix[rowIndex][columnIndex].position.set(posX, columnIndex * 2, 0);
                                } else if (currentCell) { // if cell doesn't quality for an object but already has an object
                                    scene.remove(currentCell);
                                    objectMatrix[rowIndex][columnIndex] = null;
                                }
                            });
                        });
                    }
                }

                requestAnimationFrame(() => animate(renderer, scene, camera));
            }

            new OrbitControls(camera, renderer.domElement);
            animate(renderer, scene, camera);
        },
    },
    async mounted() {
        if (process.client) {
            await this.initThree();

            document.addEventListener('keyup', event => {
                if (event.keyCode === 32 && this.stopMultiplicator !== 0) {
                    this.SET_STOP_MULTIPLICATOR(0);
                } else {
                    this.SET_STOP_MULTIPLICATOR(1);
                }
            });
        }

    },
});
</script>
